from typing import List, Tuple, Any, Dict

def tuple_list_to_dict(input_list: List[Tuple[Any, Any]]) -> Dict[Any, List[Any]]:
    out_dict = {}
    for (key, value) in input_list:
        if key not in out_dict:
            out_dict[key].append(value)
        else:
            out_dict[key] = [value]
    return out_dict
